Incredibly humbled and honored to win Best Director at the Mammoth Film Festival. The whole festival circuit has been such an exciting experience! Thank you to everyone for your incredibly kind words of support for this first time film maker. It means more than you know! And of course a huge thank you again to my incredible cast and crew without whom none of this would have been possible. 
@madbrew @indyamoore @ryankarmstrong @summerfontana1 @oliverspenceman 
@DrewAlanDaniels 
@BradFuller @CameronFuller @rickireisner #WilliamDayFrank #MikeBayman @mammothfilmfestival @savfilmfest

