@shaunwhite

• Official first look of THE ONE • 
A huge thank you to Madeline Brewer (@madbrew) and Indya Moore (@indyamoore) for bringing their passion and immense talents to these roles. You both gave such beautiful and chilling performances, bringing the words and these characters to life. For that I am eternally grateful. It was an honor and privilege to work with you. Thank you for trusting me as a first time director. Beyond proud of what we created together.
A huge thank you to the rest of the cast, and the incredible crew and collaborators who worked tirelessly to make this possible. I couldn’t have done it without you. Thank you for all of your support. 
#WilliamDayFrank (co-writer and brilliant mind)
@DrewAlanDaniels (Director of Photography extraorinaire) 
