If you can, please help. The Kevin Richardson Foundation is a non-profit conservation organisation with nature’s most majestic creature, the lion, at its heart. The foundation is committed to changing and reversing the state of Africa’s declining lion population by purchasing habitat and raising awareness to create safe, natural spaces where lions and other native species can flourish. By partnering with specialised organisations and engaging with impoverished communities on the fringes of these protected areas, the foundation also aims to minimise human/wildlife conflict whilst improving living conditions for local villages. Follow Kevin here 👉🏼
@lionwhisperersa and DONATE if you have the means. These big beautiful felines need our help. To read more about Kevin and the cats, head to http://www.lionwhisperer.co.za
