The brilliant Jane Goodall.  #JANE is an incredible documentary made about her life and her studies of social and family interactions of wild chimpanzees. Jane made it her life’s mission to understand and protect the chimps. Her story is beyond inspiring and emotional. Jane’s passion is infectious, and her accomplishments are unprecedented. Her work and research over the past 55 years (the longest continuous study of wildlife in history) speaks for itself. Watch this film. We wouldn’t know what we know today if it hadn’t been for Jane. Her fearlessness. Her patience. Her intrigue and natural curiosity. 
@nationalgeographicpictures gives us a window into her world, transporting the viewer into another time. This film is a beautiful love triangle. The love between a chimp mother and her child. A human woman her baby. And a woman and her work. 
Watch this film and when you do please go to http://www.cinemaeyehonors.com/vote. to Vote for the BEST documentary of the year — #JANE. (LINK IN BIO)

